import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate, Link } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';

function LoginPage() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const [success, setSuccess] = useState(''); // Ostavljamo success message ako želiš da se prikaže

  const { login } = useAuth();
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess(''); // Resetuj poruke

    try {
      // Šalje email i lozinku na backend
      const response = await axios.post('http://localhost:8081/auth/login', {
        email,
        password,
      });

      // Uspješna prijava, response.data sadrži cijeli AuthResponse objekt
      console.log("LoginPage: Odgovor sa backenda:", response.data);

      // Pozovi login funkciju iz AuthContext-a sa CIJELIM response.data objektom
      login(response.data);

      setSuccess(response.data.message || 'Prijava uspješna!'); // Prikaz poruke iz backenda
      console.log('LoginPage: Prijava uspješna. Preusmjeravam...');

      // Preusmjeravanje ovisno o ulozi
      const userRoles = response.data.roles; // Dohvati role direktno iz response.data
      if (userRoles && userRoles.includes('ROLE_ADMIN')) {
        navigate('/admin-dashboard');
      } else if (userRoles && userRoles.includes('ROLE_DOKTOR')) {
        navigate('/doctor-dashboard');
      } else if (userRoles && userRoles.includes('ROLE_PACIJENT')) {
        navigate('/patient-dashboard');
      } else {
        navigate('/'); // Default preusmjeravanje
      }

    } catch (err) {
      console.error('LoginPage: Greška prilikom prijave:', err.response?.data || err.message);
      // Prikazi specifičnu poruku greške sa backenda ako postoji, inače generičku
      setError(err.response?.data?.message || 'Došlo je do greške prilikom prijave. Pokušajte ponovo.');
    }
  };

  return (
    <div className="container d-flex justify-content-center align-items-center" style={{ minHeight: '80vh' }}>
      <div className="card shadow-lg p-4" style={{ maxWidth: '400px', width: '100%' }}>
        <div className="card-body">
          <h2 className="card-title text-center mb-4 text-danger">Prijava na WinxCare</h2> {/* AŽURIRANO: Prijava na WinxCare */}
          {error && (
            <div className="alert alert-danger text-center" role="alert">
              {error}
            </div>
          )}
          {success && (
            <div className="alert alert-success text-center" role="alert">
              {success}
            </div>
          )}
          <form onSubmit={handleSubmit}>
            <div className="mb-3">
              <label htmlFor="emailInput" className="form-label">Email adresa</label> {/* AŽURIRANO */}
              <input
                type="email"
                className="form-control"
                id="emailInput"
                placeholder="ime@primjer.com"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
              />
            </div>
            <div className="mb-3">
              <label htmlFor="passwordInput" className="form-label">Lozinka</label> {/* AŽURIRANO */}
              <input
                type="password"
                className="form-control"
                id="passwordInput"
                placeholder="Lozinka" 
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                required
              />
            </div>
            <div className="d-grid gap-2 mb-3">
              <button type="submit" className="btn btn-danger btn-lg">Prijava</button> {/* AŽURIRANO */}
            </div>
          </form>
          <div className="text-center mt-3">
            <Link to="/forgot-password" className="text-muted text-decoration-none">Zaboravili ste lozinku?</Link> {/* AŽURIRANO */}
          </div>
          <div className="text-center mt-2">
            <p className="text-muted">Nemate račun? <Link to="/sign-up" className="text-danger text-decoration-none">Registrujte se</Link></p> {/* AŽURIRANO */}
          </div>
        </div>
      </div>
    </div>
  );
}

export default LoginPage;
